      'Asuransi Tambahan PRUWell Health Syariah memberikan pembayaran manfaat asuransi kesehatan sesuai tagihan Rumah Sakit untuk beberapa manfaat berdasarkan Tabel Manfaat PRUWell Health Syariah, sesuai dengan Plan yang dipilih Pemegang Polis, dan memberikan keringanan Biaya Asuransi hingga 20% melalui PRUWell sebagai reward bagi mereka yang menjaga hidup sehat.\nUntuk dapat memiliki Asuransi Tambahan PRUWell Health Syariah, Tertanggung Utama harus berusia antara 30 (tiga puluh) hari (usia sebenarnya) sampai dengan 75 (tujuh puluh lima) tahun (ulang tahun berikutnya) di mana Pertanggungan akan diberikan hingga Tertanggung Utama mencapai usia 55/65/75/85/99 tahun (sesuai dengan pilihan Pemegang Polis).\nPRUWell Health Syariah hadir dengan memberikan pilihan Plan mulai dari Plan Bronze hingga Plan Diamond, beserta fasilitas lainnya untuk melengkapi perlindungan kesehatan Tertanggung Utama\n1. PRUWell Saver adalah fasilitas pilihan yang memungkinkan Pemegang Polis untuk mendapatkan perlindungan dengan Kontribusi yang lebih rendah, jika Pemegang Polis memilih untuk menanggung sendiri sejumlah biaya rawat inap hingga batas tertentu sesuai Plan yang  dipilih.\n2. Tersedia PRUWell Limit Booster yang dapat menambah Batas Manfaat Tahunan Asuransi Tambahan PRUWell Health Syariah yang hanya diberikan satu kali di awal Masa Pertanggungan\nHal yang perlu diperhatikan untuk Asuransi Tambahan PRUWell Health Syariah adalah sebagai berikut:\n1. Dalam pengajuan Asuransi Tambahan PRUWell Health Syariah, setiap Tertanggung Utama hanya boleh memiliki maksimal 1 (satu) Asuransi Kesehatan sejenis di Prudential Indonesia.\n2. Besarnya Biaya Asuransi untuk PRUWell Health Syariah pada tahun pertanggungan selanjutnya sampai akhir Masa Pertanggungan akan berubah dan dikenakan sesuai dengan Usia Tertanggung Utama, Multiplier yang dikenakan, dan PRUWell yang dikenakan (Jika ada) serta dapat berubah sewaktu-waktu sebagai penyesuaian atas, termasuk namun tidak terbatas pada pengalaman klaim secara portofolio, inflasi biaya kesehatan, ataupun pilihan PRUWell Saver.',
